desktopweb.customCSS:
input:focus{
    outline: none;
  }
  textarea:focus{
    outline: #002B5C auto 1px;
  }
  div[kw="Calendar"]>img{
  padding: 2.5% !important;
  }

  .btnSkipNavigation {
      transform: translateY(-1000px);
  }
  .btnSkipNavigation:focus {
      transform: translateY(0px);
  }
  .btnMenu,.btnMenu-focus{
    background-size: 25px 25px !important;
    background-position: center !important;
  }
  .txtAreaResize{
    resize:both !important;
    border: 1px solid;
    max-width: 90%;
  }
div[kw="FlexContainer"]:focus {
	outline: #002B5C auto 1px;
    outline-offset: -2px;
}
img:focus {
	outline: #002B5C auto 1px;
	outline-offset: 4px;
}
button[kw="Button"]:focus {
	outline: #002B5C auto 1px;
	outline-offset: 3px;
}
input[kw="TextBox2"]:focus {
	outline: #002B5C auto 1px;
    outline-offset: 0px;
}
label:focus {
	outline: none;
}
div[kw="RichText"]:focus {
	outline: none;
}
.defRichTextNormal-linkfocus > a {
  cursor: pointer !important;
}
select[kw="ListBox"]:focus {
  outline: #002B5C auto 1px;
  outline-offset: 0px;
}

::-ms-reveal {
    display: none;
}

